import React from "react"

function Title() {
	return (
		<div className="graphic">
			<div className="container">
				<h1 className="name">Omkar Waingankar</h1>
				<h2 className="name-title">University of California, Berkeley</h2>
			</div>
		</div>
	)
}

export default Title
